INSERT INTO `catalog_manufacturers` (`id`, `title`, `description`, `status`, `slug`, `meta_title`, `meta_description`, `meta_keywords`, `updated_at`, `created_at`) VALUES
(1, 'Производитель', NULL, 'publish', 'proizvoditel', NULL, NULL, NULL, '2021-05-05 14:19:44', '2021-05-05 14:19:44'),
(3, 'Darvish', '<div class=\"short__box\">\r\n<p>Собственный бренд Darvish был зарегистрирован в Национальном центре интеллектуальной собственности Республики Беларусь в 2008г. На данный момент наша торговая марка прошла международную регистрацию в России, Европе и Азии. Под ТМ Darvish мы реализуем канцелярские товары для <a href=\"/katalog/tovary_dlja_shkoly/\">школы</a> и <a href=\"/katalog/ofisnaja_kanceljarija/\">офиса</a>, <a href=\"/katalog/igrushki_i__tvorchestvo/\">продукцию для творчества</a>, праздничную, <a href=\"/katalog/tovary_dlja_doma_i_hoztovary/suveniry/\">сувенирную</a> и новогоднюю продукцию, а также <a href=\"/katalog/tovary_dlja_shkoly/svetootrazhateli/\">светоотражающие изделия</a> в широком ассортименте. Заказы на производство товаров под нашим логотипом размещены более чем у 30 предприятий-изготовителей, находящихся в Китае, России, Украине и Беларуси. За достаточно недлительное время существования на рынке бренд Darvish®  уже завоевал доверие потребителей и приобрел своих приверженцев благодаря оптимальному соотношению цена/качество, современному оригинальному дизайну, отличным потребительским характеристикам.</p>\r\n</div>', 'publish', 'darvish', NULL, NULL, NULL, '2021-05-06 15:41:32', '2021-05-06 15:41:32'),
(4, 'Mr.Boo', NULL, 'publish', 'mr-boo', NULL, NULL, NULL, '2021-05-06 18:19:15', '2021-05-06 18:19:15'),
(5, 'Радуга-смайлик d-4.5см. Игрушка', NULL, 'publish', 'raduga-smaylik-d-4-5sm-igrushka', NULL, NULL, NULL, '2021-05-06 18:19:42', '2021-05-06 18:19:42'),
