(7, 'Бренды', NULL, 'publish', 'brendy', NULL, NULL, NULL, '2021-05-06 18:20:01', '2021-05-06 18:20:01'),
(8, 'Материал декоративный Greenwich Line \"Пушистая про...', NULL, 'publish', 'material-dekorativnyy-greenwich-line-pushistaya-pro', NULL, NULL, NULL, '2021-05-06 18:20:05', '2021-05-06 18:20:05'),
(9, 'Луч', '<div class=\"short__box\">\r\n<p>«Компания «ЛУЧ» - это целая эпоха на рынке российских канцтоваров. История предприятия насчитывает уже более восьмидесяти лет. Вначале это была артель по производству товаров народного потребления, которая затем превратилась в целую фабрику. На сегодняшний день компания «ЛУЧ» - ведущий производитель товаров для детского творчества. Это динамично развивающееся предприятие, оснащенное современным оборудованием ведущих производителей, обладающее уникальной инфраструктурой: собственное конструкторское бюро, лаборатория, цех по литью пластмасс, цех изготовления и ремонта оснастки и многое другое. \r\nВоплощая свои идеи в жизнь, коллектив завода создает высококачественную, безопасную продукцию, пользующуюся популярностью и доверием у детей и взрослых всех возрастов. Под ТМ ЛУЧ в нашем ассортименте Вы найдете: <a href=\"/katalog/tovary_dlja_shkoly/kraski_geli_guash/\">краски и гуашь</a>, карандаши восковые и масляные, пластилин, <a href=\"/katalog/tovary_dlja_shkoly/trafarety/\">трафареты</a>, <a href=\"/katalog/tovary_dlja_shkoly/stakanyneprolivajki_palitry_fartuki/\">стаканы-непроливайки</a> и палитры, <a href=\"/katalog/ofisnaja_kanceljarija/klej/\">клей</a> и <a href=\"/katalog/ofisnaja_kanceljarija/skotch/\">скотч</a>.</p>\r\n</div>', 'publish', 'luch', NULL, NULL, NULL, '2021-05-06 18:20:13', '2021-05-06 18:20:13'),
